import React from 'react';
import { Card , CardImg, CardText, CardBody, CardTitle } from 'reactstrap';

function RenderCard({item}) {
    return (
        <Card>
            <CardImg src={item.image} alt={item.name} />
        </Card>
    );
}


function Home(props) {
    return (
        <div className="container">
            <h4>Home</h4>
        </div>
    )
}

export default Home;
